import React, { useState, useEffect } from 'react';
import { List, Card, message } from 'antd';
import * as XLSX from 'xlsx';

const PropertyList = ({ properties }) => {
  const [excelData, setExcelData] = useState([]);

  useEffect(() => {
    const fetchExcelData = () => {
      try {
        const wb = XLSX.readFile('EmlakVerileri.xlsx');
        const ws = wb.Sheets['EmlakVerileri'];
        const data = XLSX.utils.sheet_to_json(ws);
        setExcelData(data);
      } catch (error) {
        console.error('Excel verileri okunurken hata oluştu:', error);
        message.error('Excel verileri okunurken bir hata oluştu');
      }
    };

    fetchExcelData();
  }, [properties]);

  return (
    <div style={{ maxWidth: 800, margin: 'auto' }}>
      <h1>Emlak Listesi</h1>
      <List
        grid={{ gutter: 16, column: 1 }}
        dataSource={excelData}
        renderItem={item => (
          <List.Item>
            <Card title={item.ilanbaslik}>
              <p>Açıklama: {item.ilanaciklama}</p>
              <p>Fiyat: {item.fiyat}</p>
              <p>İl: {item.il}</p>
              <p>İlçe: {item.ilce}</p>
              <p>Kategori: {item.kategori}</p>
              <p>Tür: {item.tur}</p>
            </Card>
          </List.Item>
        )}
      />
    </div>
  );
};

export default PropertyList;
